import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-info">
        <h1>Luciano Ariel Moyano</h1>
        <p>Buenos Aires, Argentina</p>
      </div>
      <div className="footer-contact">
        <h2 className="footer-contact">Contacto</h2>

        <p className="footer-contact">TELEFONO: +54 9 1150053555</p>

      </div>
      <div className="footer-sns">
        <div className="design-by">Design By Your Name</div>
        <div className="sns-links">
          <a href="https://www.linkedin.com/in/lucianoarielmoyano/" target="_blank" rel="noreferrer">
            <i className="fab fa-linkedin linkedin"></i>
          </a>
          <a href="https://github.com/LucianoMoyano" target="_blank" rel="noreferrer">
            <i className="fab fa-github github"></i>
          </a>

        </div>
      </div>
    </footer>
  );
};

export default Footer;
